using MahApps.Metro.Controls;
using System;
using System.IO;
using System.Windows;
using System.Windows.Controls;
using System.Windows.Media.Imaging;

namespace GamersApp
{
  /// <summary>
  /// Interaction logic for About.xaml
  /// </summary>
  public partial class About : MetroWindow
  {
    /// <summary>
    /// The image to be shown in the window in base64 format;
    /// </summary>
    private string AuthorPhoto = "";

    public About()
    {
      InitializeComponent();

      SetPhotoFromBase64();
    }

    /// <summary>
    /// Sets the photo to be shown on the top right area of the window
    /// </summary>
    private void SetPhotoFromBase64()
    {
      byte[] binaryData = Convert.FromBase64String(AuthorPhoto);

      BitmapImage BitmapImage = new BitmapImage();
      BitmapImage.BeginInit();
      BitmapImage.StreamSource = new MemoryStream(binaryData);
      BitmapImage.EndInit();

      imgAuthorPhoto.Source = BitmapImage;
    }
  }
}
